import java.util.Arrays;
import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long k = sc.nextLong();
        long[] arrayA = new long[n];

        for (int i = 0; i < n; i++) {
            arrayA[i] = sc.nextInt();
        }
        Arrays.sort(arrayA);
        long l = 0;
        long r = arrayA[n - 1];
        long max = -1;
        while (l <= r) {
            long middle = (l + r)/2;
            long sum = check(arrayA, k, middle);
            if (sum >= k) {
                max = middle;
                l = middle + 1;
            } else {
                r = middle - 1;
            }
        }
        System.out.println(max);
    }

    static long check(long[] arrayA, long k, long sawHeight) {
        long sum = 0;
        for (int i = 0; i < arrayA.length; i++) {
            if (arrayA[i] > sawHeight) {
                sum += arrayA[i] - sawHeight;
            }
        }

        return sum;
    }
}
